@ebeautydna has launched DNA Test Kits for Asians to help consumers discover the full spectrum of their own individual traits and information related to skin, fitness and nutrition. This DNA test also allows us to discover our genetic abilities, behavioural traits, disease risk factors and fitness profiles. 

Simply register and activate the DNA self-test kits online and collect your own saliva samples before sending it to the laboratory for analysis. 

You should receive a detailed customised DNA report in 10-15 working days, it also includes a personal consultation with e-beauty's wellness partner. I'm looking forward to receiving my detailed report to find out more about myself ‚úåüèº

